import React from 'react';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import { NavBar } from "./NavBar";

function Navibar(){
    return(
        <>
            <BrowserRouter>
                <NavBar />
                <Switch>
                <Route path="/" exact>
                    <HomePage />
                </Route>
                <Route path="/about">
                    <AboutPage />
                </Route>
                <Route path="/contact">
                    <ContactPage />
                </Route>
                </Switch>
            </BrowserRouter>
        </> 
    );
}

export default Navibar
